import { ReactComponent as SvgIcon } from '../../assets/svgs/arrow-growth.svg';
import { IconProps } from './IconProps.types';

export default function ArrowGrowthIcon({ height = '20px', width = '20px', ...restProps }: IconProps): JSX.Element {
  return <SvgIcon height={height} width={width} {...restProps} />;
}
